column8:
シャネル コットン 100枚入 CHANEL LE COTON <br>
 <br>
ブランド:CHANEL シャネル<br>
 <br>
用途／タイプ:コットン<br>
 <br>
容量:100枚<br>
 <br>
商品説明:<br>
丁寧に育まれた希少で高級な原綿を採用したシャネルこだわりのお手入れ用コットンです。<br>
ソフトでなめらかな肌触りと化粧水を肌に届ける機能性を追求し、毎日のお手入れに上質の心地よさをもたらします。<br>
表側はエジプト綿、中はオーストラリア綿を使っており化粧水をしっかり吸い込む吸水性と吸い込んだ化粧水を表に十分に出す発水性に優れています。<br>
<br>
コットンで化粧水をつけることによって、肌深部に浸透しまた肌体温を下げる効果もあります。<br>
<br>
■使い方：<br>
1.コットンの裏側まで十分に濡れるくらい化粧水をつける<br>
2.コットンを利き手に持ち替えて、人さし指と薬指、もしくは人さし指と小指ではさんで持つ<br>
3.顔の内側から外側に向かって、頬や額など広い部分から、鼻、あごと丁寧にふくようにつける<br>
4.化粧水が収れん化粧水であれば、上記の順でやさしくパッティングする<br>
5.そのまま首に移動し、首の下から上に向かってふくようになじませる<br>
6.足りない場合には、同じコットンに少量の化粧水をたして繰り返す<br><style type="text/css">

